script: |
  super -f tsv -I q9337.sql | sort > q9337.out

vector: true

inputs:
  - name: q9337.sql
    data: |
      pragma pg
      SELECT ALL col1 / + col1 AS col2 FROM tab0 GROUP BY col2, col1 HAVING NOT - - ( + 29 ) * + col1 + - 50 + col1 < col2;
  - name: tab0

outputs:
  - name: q9337.out
    data: |
      1
